import { Link } from "react-router-dom";
import './pages/header.css'
function Menu(){
    return(
        <div >
            <nav className="nav" >
                <ul className="ul">
                <li><Link className="Nav1" to={"/Inicio"}>Inicio</Link></li>
               <li> <Link className="Nav1" to={"/Productos"}>Productos</Link></li>
               <li> <Link className="Nav1" to={"/Contacto"}>Contacto</Link> </li> 
               <li><Link className="Nav1" to={"/Info"}>Info</Link></li> 
               <li> <Link className="Nav1" to={"/Usuario"}>Usuario</Link></li>
                </ul>
            </nav>
        </div>
    )
}
export default Menu;
